  REGI02_Box3v01TH,
  REGI02_Box5v01EN,
  REGI02_Box5v01DE,
  REGI02_Box5v01TH,
  REGI02_Box6EN,
  REGI02_Box6DE,
  REGI02_Box6TH,
} from "../Data/DataLanguage";

import {
  IconButton,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Input,
  Modal,
  Typography,
